var handleDataTableRowReorder = function () {
        "use strict";
        0 !== $("#data-table").length && $("#data-table").DataTable({
            rowReorder: !0,
            responsive: !0
        })
    },
    PageDemo = function () {
        "use strict";
        return {
            init: function () {
                handleDataTableRowReorder()
            }
        }
    }();
